/// <summary>
/// Gets and sets the value of the <c>BreakTime</c> field on the <c>JmgStampJournalTrans</c> record.
/// </summary>
/// <param name="_set">
/// A Boolean value that specifies whether the value must be updated.
/// </param>
/// <param name="value">
/// The new value of the <c>BreakTime</c> field.
/// </param>
/// <returns>
/// The value of the <c>BreakSeconds</c> field formatted as a string.
/// </returns>
edit JmgLabelSecondsBreak breakSeconds(boolean _set, JmgTimeString value)
{
    if (_set)
    {
        this.BreakTime = JmgProfileSeconds::unFormattedSeconds(value,JmgSecondPresentationEnum::Minuts);
    }

    return JmgProfileSeconds::formattedSeconds(this.BreakTime,JmgSecondPresentationEnum::Minuts);
}

