/// <summary>
/// Gets the activity description that is associated to the <c>JmgStampTrans</c> record for indirect activity or absence records.
/// </summary>
/// <returns>
/// The activity description if the <c>JmgStampTrans</c> record refers to an indirect
/// activity or absence; otherwise, the empty string.
/// </returns>
display JmgDescription ipcActivityDescription()
{
    if (this.Module == JmgModuleEnum::IPC)
    {
        if (this.JourRegType == JmgJourRegTypeEnum::IndActivity)
        {
            return JmgIpcActivity::findActivityId(this.ipcActivity()).Description;
        }
        else if (this.JourRegType == JmgJourRegTypeEnum::Absence)
        {
            return HRMAbsenceCode::find(this.ipcActivity()).description;
        }
    }
    return "";
}

