/// <summary>
/// Retrieves the good catch weight quantity that is reported on the job that is associated with the
/// <c>JmgStampTrans</c> record.
/// </summary>
/// <returns>
/// The good catch weight quantity that is reported on the job that is associated with the
/// <c>JmgStampTrans</c> record.
/// </returns>
display PdsCWBatchGood pdsCWTotalGoodItems()
{
    if (this.Module == JmgModuleEnum::PROD)
    {
        if (JmgProdParameters::find().StampLevel == JmgStampLevel::Job)
        {
            return ProdRouteJob::findJobId(this.JobId).pdsCWReportedQtyGood();
        }
        else if (JmgProdParameters::find().StampLevel == JmgStampLevel::Route)
        {
            return ProdRoute::findJobId(this.JobId).pdsCWReportedQtyGood();
        }
    }
    return 0;
}

