/// <summary>
/// Updates the <c>JmgStampJournalTrans</c> record in the database.
/// </summary>
public void update()
{
    JmgStampTrans   oldStampTrans;
    oldStampTrans = this.orig();

    super();
    if (this.JobFinished != oldStampTrans.JobFinished)
    {
        JmgJobTable::updateReportedFinished(this.JobId, this.JobFinished);
    }
}

/// <summary>
/// Checks if registration has an error.
/// </summary>
public boolean hasJobRegistrationError()
{
    return this.QtyError || this.PdsCWQtyError;
}

/// <summary>
/// Initializes a <c>FormWindowControl</c> object with an image list that is used to depict job types.
/// </summary>
/// <param name="formWindowControl">
/// The <c>FormWindowControl</c> which is initialized.
/// </param>
static void imageListJobType(FormWindowControl formWindowControl = null)
{
    #JmgIcons

    Imagelist imagelist = new Imagelist(Imagelist::smallIconWidth(), Imagelist::smallIconHeight());

    imagelist.add(new Image(#JMG_IMG_JOBTYPE_NORMAL));
    imagelist.add(new Image(#JMG_IMG_JOBTYPE_BUNDLE1));
    imagelist.add(new Image(#JMG_IMG_JOBTYPE_BUNDLE2));
    imagelist.add(new Image(#JMG_IMG_JOBTYPE_BUNDLE3));

    if (formWindowControl)
        formWindowControl.imageList(imagelist);
}

/// <summary>
/// Initializes a <c>FormWindowControl</c> object with an image list that is used to depict module
/// types.
/// </summary>
/// <param name="formWindowControl">
/// The <c>FormWindowControl</c> object to initialize.
/// </param>
static void imageListModule(FormWindowControl formWindowControl = null)
{
    #JmgIcons

    Imagelist imagelist = new Imagelist(Imagelist::smallIconWidth(), Imagelist::smallIconHeight());

    imagelist.add(new Image(#JMG_IMG_MODULE_IPC));
    imagelist.add(new Image(#JMG_IMG_MODULE_PROD));
    imagelist.add(new Image(#JMG_IMG_MODULE_PROJ));

    if (formWindowControl)
        formWindowControl.imageList(imagelist);
}

/// <summary>
/// Initializes a <c>JmgStampTrans</c> record based on a <c>JmgStampJournalTrans</c> record.
/// </summary>
/// <param name="jmgStampJournalTrans">
/// The <c>JmgStampJournalTrans</c> record that is used to initialize a <c>JmgStampTrans</c> record.
/// </param>
/// <returns>
/// An initialized <c>JmgStampTrans</c> record.
/// </returns>
static JmgStampTrans newFrom_StampJournalTrans(JmgStampJournalTrans jmgStampJournalTrans)
{
    JmgStampTrans     jmgStampTrans;

    jmgStampTrans.initFromJmgStampJournalTrans(jmgStampJournalTrans);

    return jmgStampTrans;
}

